void UiEditorDemo::refresh_ui()
{
    if( _app_instance_store->editor_config.demo_time_is_over )
    {
        continue_->setVisible(false);
        restart->setVisible(true);
    }
    else
    {
        continue_->setVisible(true);
        restart->setVisible(false);
    }
}
