void UiEditorDemo::paint (Graphics& g)
{
    //[UserPrePaint] Add your own custom painting code here..
    //[/UserPrePaint]

    g.setColour (Colours::black);
    g.drawImage (cachedImage_demobg_png2,
                 0, 0, proportionOfWidth (1.0000f), proportionOfHeight (1.0000f),
                 0, 0, cachedImage_demobg_png2.getWidth(), cachedImage_demobg_png2.getHeight());

    g.setColour (Colour (0xffdfce89));
    g.drawRect (0, 0, proportionOfWidth (1.0000f), proportionOfHeight (1.0000f), 2);

    //[UserPaint] Add your own custom painting code here..
    ResizableWindow::moved();
    //[/UserPaint]
}

